import styled from "styled-components";

export const Container = styled.section`
    padding-top: 80px;
    height: 100vh;

    overflow-y: scroll;
`;

export const FaButton = styled.button`
    width: 50px;
    height: 50px;
    position: fixed;
    bottom: 10px;
    right: 10px;

    border-radius: 50%;
    font-size: 28px;
    font-weight: normal;

`;
